import { combineReducers } from "redux";

import alertReducer from "./alertReducer"; 
import authReducer from "./authReducer";
import modalReducer from "./modalReducer";


export default combineReducers({

    alert: alertReducer,
    modal: modalReducer,
    auth : authReducer

});
